package com.we.main;

public class AvgDust {
	
	private String gu;
	private double value;
	
	public AvgDust() {
		// TODO Auto-generated constructor stub
	}

	public AvgDust(String gu, double value) {
		super();
		this.gu = gu;
		this.value = value;
	}

	public String getGu() {
		return gu;
	}

	public void setGu(String gu) {
		this.gu = gu;
	}

	public double getValue() {
		return value;
	}

	public void setValue(double value) {
		this.value = value;
	}
	
}
